create table characters_spells
(
    Id       int auto_increment
        primary key,
    OwnerId  int      not null,
    Position smallint not null,
    SpellId  int      not null,
    Level    smallint not null,
    Active   int      null
)
    engine = MyISAM
    charset = utf8;

create index OwnerId
    on characters_spells (OwnerId);

